import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import MarkDown from './/components/MarkDown';
import MarkDownWithServer from './MarkDownWithServer';
import ConversionSelector from './ConversionSelector';

function App() {
  return (
    <Router>
      <Switch>
        <Route path="/" exact component={ConversionSelector} />
        <Route path="/client" component={MarkDown} />
        <Route path="/server" component={MarkDownWithServer} />
      </Switch>
    </Router>
  );
}

export default App;
